selector_to_html = {"a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C91.png\"><img alt=\"../../media/3030C91.png\" src=\"../../media/3030C91.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Delay 1s</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#infinite-delay-disable-same-code-scanning\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Infinite Delay (Disable Same Code Scanning)<a class=\"headerlink\" href=\"#infinite-delay-disable-same-code-scanning\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050209.png\"><img alt=\"../../media/2050209.png\" src=\"../../media/2050209.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Auto Sensing Mode</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Same Code Delay Settings<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>To prevent the same barcode from being scanned multiple times in <a class=\"reference internal\" href=\"#continuous-mode\">Continuous Mode</a> and <a class=\"reference internal\" href=\"#auto-sensing-mode\">Auto Sensing Mode</a>, you can require the scanner to wait for a set delay before allowing the same barcode to be scanned.</p>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Auto Sensing Mode<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>In the auto sensing mode, the scanner will detect the brightness of the surrounding environment. When the brightness changes, the scan is triggered. The scan ends when the scan is successful or the scan time exceeds the single working time. Regardless of whether the last scan was successful or failed, the brightness of the surrounding environment will be detected again.</p>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"#no-delay\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">No Delay<a class=\"headerlink\" href=\"#no-delay\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan Mode<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050204.png\"><img alt=\"../../media/2050204.png\" src=\"../../media/2050204.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Continuous Mode</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C93.png\"><img alt=\"../../media/3030C93.png\" src=\"../../media/3030C93.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Delay 3s</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050200.png\"><img alt=\"../../media/2050200.png\" src=\"../../media/2050200.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Key Trigger Mode</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#delay-5s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Delay 5s<a class=\"headerlink\" href=\"#delay-5s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C95.png\"><img alt=\"../../media/3030C95.png\" src=\"../../media/3030C95.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Delay 5s</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#delay-3s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Delay 3s<a class=\"headerlink\" href=\"#delay-3s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C90.png\"><img alt=\"../../media/3030C90.png\" src=\"../../media/3030C90.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">No Delay</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Continuous Mode<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>The scanner works continuously. If the scan is successful or the scan time exceeds the single working time, the current scan ends. If the time exceeds the specified time, the next scan is automatically triggered.</p>", "a[href=\"#delay-1s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Delay 1s<a class=\"headerlink\" href=\"#delay-1s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#delay-7s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Delay 7s<a class=\"headerlink\" href=\"#delay-7s\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C97.png\"><img alt=\"../../media/3030C97.png\" src=\"../../media/3030C97.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Delay 7s</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C99.png\"><img alt=\"../../media/3030C99.png\" src=\"../../media/3030C99.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Infinite Delay (Disable Same Code Scanning)</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
